    Link,
  } from "react-router-dom";
import './app.css'
function Hello() {
    return <h1>Hello</h1>
}
function App() {
    return (
        // <ChatApp></ChatApp>
        <BrowserRouter>
            <Switch>
                
            </Switch>
           <Route path = "/" component = {ChatApp} />
           <Route path = "/login" component = {Hello} />
        </BrowserRouter>
       
    )
}

export {App}
